            >
                <div id="wrapper">
                    <img src="https://res.cloudinary.com/nilson01/image/upload/v1622441807/jhoileuxkrv0eyaaoqqx.png" />

                </div >

            </Box>
        </>
    );
};

export default PageNotFound
